import React, {
  BrowserRouter as Router,
  Route,

} from "react-router-dom";
import "./App.css";
import Header from "./components/layout/Header";
import Footer from "./components/layout/Footer";
import Home from "./pages/Home";
import About from "./pages/About";

function App() {
  return (
    <Router>
      <div className="App">
        <Header />

          <Route path="/home">
            <Home />
          </Route>
          <Route path="/about">
            <About />
          </Route>

        <Footer />
      </div>
    </Router>
  );
}

export default App;
